import React from 'react';
import Header from './components/Header';
import HeroSection from './components/HeroSection';
import FeaturesSection from './components/FeaturesSection';
import AboutSection from './components/AboutSection';
import ContactSection from './components/ContactSection';
import HybridConsensusSection from './components/HybridConsensusSection'; // Import the new section
import ResourcePoolingSection from './components/ResourcePoolingSection'; // Import the new section

function App() {
  return (
    <div>
      <Header />
      <HeroSection />
      <AboutSection />
      <FeaturesSection />
      <HybridConsensusSection /> 
      <ResourcePoolingSection />
      <ContactSection />
    </div>
  );
}

export default App;
